var login = new Vue({
	el:'#login',
	data:{
		username:'',
		password:'',
		message:''
	},
	methods:{
		login:function(){
			axios.post('http://localhost:8080/user/isLoginUser',{
				username:this.username,
				password:this.password,
			})
			.then(response => {
				console.log(response)
				this.message = response.data
			})
			.catch(error => {
				console.log(error)
			})
		}
	}
})
